import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import React from 'react'
//import styles from './components/pages/App.module.css'

/* components */
import Menu from './components/layout/Menu'
//import Navbar from './components/layout/Navbar'
import Footer from './components/layout/Footer'
import Message from './components/layout/Message'
import Container from './components/layout/Container'

/* pages */
import Login from './components/pages/Auth/Login'
import Register from './components/pages/Auth/Register'
//import RegisterUsers from './components/pages/Auth/RegisterAdmins'
import Home from './components/pages/Home'
import Profile from './components/pages/User/Profile'
import MyEquipament from './components/pages/Equipament/MyEquipament'
import AddEquipament from './components/pages/Equipament/AddEquipament'
import EditEquipament from './components/pages/Equipament/EditEquipament'
import EquipamentDetails from './components/pages/Equipament/EquipamentDetails'
import MyReserving from './components/pages/Equipament/MyReserving'
//import RegisterAdmins from './components/pages/Auth/RegisterAdmins'
//import HomeUsers from './components/pages/Auth/HomeUsers'
//import ProfileAdmins from './components/pages/Admins/ProfileAdmins'
//import loginAdmins from '../src/hooks/adminsAuth'
import ForgotPass from './components/pages/User/ForgotPass'
import ResetPass from './components/pages/User/ResetPass'




/* contexts */
import { UserProvider } from './context/UserContext'
//import { AdminsProvider } from './context/AdminsContext'
//import { SidebarData } from './components/SidebarData'
//import { AdminsProvider } from './context/AdminsContext'
//PrivateRoute path="/admin" roles={['admin']} component={Admin}






function App() {  
  return (
    <Router>      
      <UserProvider>        
        <Menu />
        <Message />
        <Container>
          <Routes>
            <Route path="/login" element={<Login />}/>            
            <Route path="/register"element={<Register />} />
            <Route path="/user/profile" element={<Profile />}/>            
            <Route path="/equipament/add" element={<AddEquipament />}/>            
            <Route path="/equipament/edit/:id" element={<EditEquipament />}/>            
            <Route path="/equipament/myequipament" element={<MyEquipament />} />            
            <Route path="/equipament/myreserving" element={<MyReserving />}/>  
            <Route path="/equipament/:id" element={<EquipamentDetails />} />                                  
            <Route path="/" element={<Home />} />
            <Route path="/forgotpassword" element={<ForgotPass />}/>
            <Route path="/resetpassword" element={<ResetPass/>}/>
          </Routes>
        </Container>
        <Footer />        
      </UserProvider>      
    </Router>    
  )  
}

export default App
